import React from 'react'
import Sidebar from './Sidebar';
import {Link} from 'react-router-dom';

class Header extends React.Component {
    render(){
        return(
            <div>
            <div className = "header">
                <div class="dropdown">
                            <button class="dropbtn">Chapter 1 
                                <i class="fa fa-caret-down"></i>
                            </button>
                                <div class="dropdown-content">
                                    <Link to ="/Bisection"><li className ="button">Bisection</li></Link>
                                    <Link to ="/FalsePosition"><li className ="button">False-Position</li></Link>
                                    <li className ="button" href ="#">One-Point</li>
                                    <li className ="button" href ="#">Newton-Raphson</li>
                                    <li className ="button" href ="#">Secant</li>
                                </div>
                        </div>
                </div>
            </div>
        )
    }
}

export default Header;
